　【通常のアイアンセットとPinhawk SL シングルレングス アイアンとの違いとは？】<BR>
周知の通り、普通のアイアンセットのシャフトレングスは半インチ間隔。そのため、番手により微妙にスイングが変わってしまい、ミスショットの原因にもなり兼ねません。<BR>
そこで登場するのが、このPinhawk SL アイアンなのです。シングルレングスとは、すなわち全番手同じ長さ。しかも、バランス、シャフトフレックスも同じ。<BR>
結果、番手を通して同じスイング、同じ感覚でプレーできるのです。<BR>
<BR>
The Pinhawk SL は長さが均一というだけでなく、ゴルフクラブとしても最新のテクノロジーをも搭載しています。また、易しいクラブにありがちな不格好さとは無縁で重心設定、ソール形状にもこだわりの感じられる秀作。ソール幅もさほど広くなく、程よいオフセットも自慢のひとつです。<BR>
<BR>
番手間のロフト差が従来のアイアンに比べ大きいのは、番別飛距離を最適化するため。飛距離のギャップが通常のアイアンセットとほぼ同じということに気づいて頂けるはずです。<BR>
<BR>
お奨めレングスは通常の7番アイアンと同じ37インチですが、お好みにより上は38インチ、下は36.5インチまで調整可能です。<BR>
<BR>
従来型のアイアンと比較し、ライ角、ヘッド重量、オフセットが均一になっているところにご注目して下さい。<BR>
<BR>
<BR>
【ヘッドスペック】<BR>
Face：431 Stainless<BR>
Body：431 Stainless<BR>
Hosel Bore：0.370"<BR>
Blade Length（#5）：85mm<BR>
Sole Length（#5）: 18mm<BR>
<BR>
